func MassInsert_PhoneContacts(rows []PhoneContacts, db XODB) error {
	if len(rows) == 0 {
		return errors.New("rows slice should not be empty - inserted nothing")
	}
	var err error
	ln := len(rows)
	s := "(?,?,?,?,?)," //`(?, ?, ?, ?),`
	insVals_ := strings.Repeat(s, ln)
	insVals := insVals_[0 : len(insVals_)-1]
	// sql query
	sqlstr := "INSERT INTO sun.phone_contacts (" +
		"UserId, ClientId, Phone, FirstName, LastName" +
		") VALUES " + insVals

	// run query
	vals := make([]interface{}, 0, ln*5) //5 fields

	for _, row := range rows {
		// vals = append(vals,row.UserId)
		vals = append(vals, row.UserId)
		vals = append(vals, row.ClientId)
		vals = append(vals, row.Phone)
		vals = append(vals, row.FirstName)
		vals = append(vals, row.LastName)

	}

	if LogTableSqlReq.PhoneContacts {
		XOLog(sqlstr, " MassInsert len = ", ln, vals)
	}
	_, err = db.Exec(sqlstr, vals...)
	if err != nil {
		if LogTableSqlReq.PhoneContacts {
			XOLogErr(err)
		}
		return err
	}

	return nil
}

